(44, '2024-11-23 19:36:43', 1, '2024-02-12 15:57:22', 1, 7, 43, 'Y', 'N', 500, 'Russisk eksport til Europa sank med to tredeler i 2023', NULL, 164, 165, 2, 'Den russiske eksporten til europeiske land falt med mer enn to tredeler i 2023. Vestlige sanksjoner har ført den russiske eksporten mot Asia.\r\nEtter den russiske invasjonen av Ukraina innførte europeiske land en lang rekke sanksjoner på den russiske økonomien, samtidig som de vendte seg vekk fra russisk olje og gass.\r\n\r\nDet har ført til at Russlands eksport til Europa falt med 68 prosent i 2023, til 84,9 milliarder dollar. Det skriver det statlige russiske nyhetsbyrået Interfax, og viser til tall fra det russiske tolldirektoratet.\r\n\r\nSanksjonsregimet har ført til at Russland i stedet har økt sin eksport til Asia, som økte med 5,6 prosent i 2023. Handelen med Kina nådde rekordhøye 240 milliarder dollar i fjor, ifølge kinesiske myndigheter.\r\n\r\nRussisk import fra Europa falt også i fjor, med en nedgang på 12,3 prosent.\r\n\r\nTotalt landet Russlands handelsoverskudd på 140 milliarder dollar i 2023. Det er en nedgang på 58,5 prosent sammenlignet med 2022.', 'text', 'RUSSISK EKSPORT TIL EUROPA SANK MED TO TREDELER I 2023\r\nDEN RUSSISKE EKSPORTEN TIL EUROPEISKE LAND FALT MED MER ENN TO TREDELER I 2023. VESTLIGE SANKSJONER HAR FØRT DEN RUSSISKE EKSPORTEN MOT ASIA.\r\nETTER DEN RUSSISKE INVASJONEN AV UKRAINA INNFØRTE EUROPEISKE LAND EN LANG REKKE SANKSJONER PÅ DEN RUSSISKE ØKONOMIEN, SAMTIDIG SOM DE VENDTE SEG VEKK FRA RUSSISK OLJE OG GASS.\r\n\r\nDET HAR FØRT TIL AT RUSSLANDS EKSPORT TIL EUROPA FALT MED 68 PROSENT I 2023, TIL 84,9 MILLIARDER DOLLAR. DET SKRIVER DET STATLIGE RUSSISKE NYHETSBYRÅET INTERFAX, OG VISER TIL TALL FRA DET RUSSISKE TOLLDIREKTORATET.\r\n\r\nSANKSJONSREGIMET HAR FØRT TIL AT RUSSLAND I STEDET HAR ØKT SIN EKSPORT TIL ASIA, SOM ØKTE MED 5,6 PROSENT I 2023. HANDELEN MED KINA NÅDDE REKORDHØYE 240 MILLIARDER DOLLAR I FJOR, IFØLGE KINESISKE MYNDIGHETER.\r\n\r\nRUSSISK IMPORT FRA EUROPA FALT OGSÅ I FJOR, MED EN NEDGANG PÅ 12,3 PROSENT.\r\n\r\nTOTALT LANDET RUSSLANDS HANDELSOVERSKUDD PÅ 140 MILLIARDER DOLLAR I 2023. DET ER EN NEDGANG PÅ 58,5 PROSENT SAMMENLIGNET MED 2022.', '', '44', NULL, NULL, NULL),
